import React from 'react';
import Axios from 'axios';

class DeveloperinProject extends React.Component{
    constructor(props){
        super(props);
        this.state={data:[],err:0}
        Axios.get(`http://localhost:3002/getdeveloperinproject/${this.props.match.params.id}`).then(res=>{
            this.setState({data:res.data})
            console.log(res.data)
            })
    }

    render(){
        console.log(this.state.data);
        const developer=this.state.data.developer.map(i=>{
            Axios.get(`http://localhost:3002/developerdetail/${i}`)

        })
        return(
            {developer}
        )
    }
}
export default DeveloperinProject;
